import React,{Component} from 'react';
import ReactDOM from "react-dom";
import './App.css';

class App extends Component {
  componentDidMount() {
    const script = document.createElement("script");
    script.async = true;
    script.src = "main.js";
    document.body.appendChild(script);
  }

  render(){
    return (
      <div className="App">Welcome to typeracer!</div>
    );
  }
}

// const App = () => {
//   return (<div className="App">Welcome to typeracer!</div>);
//   }
export default App;
